// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Desafio {

    uint ultimoNumero;
    uint acumulador;

    function guardar(uint num) public {
        ultimoNumero = num;
        acumulador += ultimoNumero;
    }

    function leer() public view returns (uint, uint) {
        return (acumulador, ultimoNumero);
    }
}

